'use strict';

import axios from 'axios';
import path from 'path';
import express from 'express';
import session from 'express-session';
import { fileURLToPath } from 'url';

const __filename = fileURLToPath(import.meta.url);
const __dirname = path.dirname(__filename);

axios.defaults.headers.common = {
    'Accept': 'text/plain,application/json,*/*',
    'Accept-Language': 'en-US,en',
    'Accept-Encoding': 'gzip, deflate, br',
    'Connection': 'keep-alive',
    'Upgrade-Insecure-Requests': '1',
    'Metadata-Flavor': 'Google',
    'Pragma': 'no-cache',
    'Cache-Control': 'no-cache'
};

const app = express();
const port = 8080;

app.use(express.urlencoded({ extended: false }))
app.use(session({
    resave: false,
    saveUninitialized: false,
    secret: 'very secret secret'
}));

const users = {
    foo: {
        password: 'bar',
        username: 'foo',
        fullname: 'Foo Bar',
        email: 'foobar@example.com',
        about: 'Fugiat ipsum ipsum deserunt culpa aute sint do nostrud anim incididunt cillum culpa consequat. Excepteur qui ipsum aliquip consequat sint. Sit id mollit nulla mollit nostrud in ea officia proident. Irure nostrud pariatur mollit ad adipisicing reprehenderit deserunt qui eu.',
        picture: 'data:image/jpeg;base64,',
    }
};

function authenticate(username, password, fn) {
    var user = users[username];
    if (!user) return fn(null, null);
    if (password === user.password) return fn(null, user);
}

function restrict(req, res, next) {
    if (req.session.user) {
        next();
    } else {
        res.redirect('/login');
    }
}

function apiRestrict(req, res, next) {
    if (req.session.user) {
        next();
    } else {
        res.status(403).send('Access denied');
    }
}

app.get('/', function(req, res){
    res.redirect('/login');
});

app.get('/login', function(req, res){
    res.sendFile(path.join(__dirname, 'views', 'login.html'));
});

app.get('/profile', function(req, res) {
    res.sendFile(path.join(__dirname, 'views', 'profile.html'));
});

const api = express.Router();
app.use('/api', api);

api.post('/login', function (req, res, next) {
    authenticate(req.body.username, req.body.password, function(err, user) {
        if (err) return next(err)
        if (user) {
            req.session.regenerate(function(){
                req.session.user = user;
            });
            res.redirect('/profile');
        } else {
            res.redirect('/login');
        }
    });
});

api.get('/profile', (req, res) => {
    // const user = req.session.user;
    const user = users["foo"];
    const { password, ...userWithoutPassword } = user;
    res.json(userWithoutPassword);
});

api.post('/profile/picture-upload', async (req, res) => {
    if (!req.body.file && !req.body.url) {
        return res.status(400).send('Missing file/URL parameter');
    }

    let image;

    if (req.body.file) {
        image = req.body.file;
    } else {
        try {
            const url = new URL(req.body.url);
            const response = await axios.get(url, {
                responseType: 'arraybuffer'
            });
            const contentType = response.headers['content-type'];
            const imageBuffer = response.data;
            image = `data:${contentType};base64,${imageBuffer.toString('base64')}`;
        }
        catch (error) {
            return res.status(400).send('Failed to download image');
        }
    }

    // const user = users[req.session.user.username];
    const user = users["foo"];
    user.picture = image;

    res.send(image);
});

app.listen(port, () => {
    console.log(`Server listening on port ${port}`);
});
